async function showFriends() {
    objectManager = new ymaps.ObjectManager({
        // Чтобы метки начали кластеризоваться, выставляем опцию.
        clusterize: true,
        // ObjectManager принимает те же опции, что и кластеризатор.
        gridSize: 110,
        clusterDisableClickZoom: true
    });

    // Чтобы задать опции одиночным объектам и кластерам,
    // обратимся к дочерним коллекциям ObjectManager.
    /*objectManager.objects.options.set('preset', 'islands#greenDotIcon');
    objectManager.clusters.options.set('preset', 'islands#greenClusterIcons');
    myMap.geoObjects.add(objectManager);*/

    var myCoords = [[55.7, 37.6],
                [59.9, 30.3],
                [59.2, 39.9]];
    // objectManager.objects.options.set('preset', 'islands#greenCircleDotIcon');
    objectManager.objects.options.set('preset', 'islands#greenStretchyIcon');
    objectManager.clusters.options.set('preset', 'islands#greenClusterIcons');
    myMap.geoObjects.add(objectManager);


    let vk_id = document.getElementById("vk_id").value;
    // console.log(vk_id);
    friends = await(get_friends(vk_id));
    var fr = await JSON.parse(friends["friends"]);
    console.log(fr);


    var currentId = 0;
    for (const element of fr.response.items) {
        try {
            if (!element.hasOwnProperty("city") || !element.city.hasOwnProperty("title")) {
                continue;
            }
            var city = element.city.title;
            if (citiesDB.cities.hasOwnProperty(city)) {
                var xc = citiesDB.cities[city][0];
                var yc = citiesDB.cities[city][1];
                var name = element.first_name + ' ' + element.last_name;
                console.log(name, city, xc, yc);
                objectManager.add({
                    type: 'Feature',
                    id: currentId++,
                    geometry: {
                        type: 'Point',
                        coordinates: [xc, yc]
                    },
                    properties: {
                        hintContent: name,
                        iconContent: name
                        // balloonContent: 
                    }
                });
            } else {
                console.log(city, "No city like this");
            }
        } catch(err) {
            console.log("I CATCHED: " + err);
        }
    }

    console.log(objectManager.objects);

    // console.log(friends);
}

